LocaleInfo.ui_metadata_aggregation_unit_AggregationContentsPane_defaultFilterConditionScriptComment = "集計画面初期表示にデフォルトで設定する条件を指定するGroovyScriptです。<BR />変数としてinitCondMap(Map&lt;String, String&gt;)がバインドされています。<BR />このスクリプト内でinitCondMapに「key:条件名(後述)、value：初期条件とする値(文字列)」という形式で値を設定することで初期条件として値が設定されます。<BR /><BR/>バインド変数として、「user：ユーザ情報」、「request：リクエスト情報」、「session：セッション情報」が予めバインドされています。<BR/>リクエストパラメータで下記条件が指定された場合は、予めinitCondMapに設定されています。<BR /><BR/>設定可能な条件は以下になります。<div style=\"width:500px; height:330px; overflow:auto; border:1px solid #000000\">xxxはプロパティ名(フィルタ設定のプロパティ定義名)、yはインデックス(同一項目での複数指定、0から指定)を指定してください。<br /><ul style=\"padding-left: 20px;\"><li>doFilterAggregation: trueの場合表示時にフィルタ条件を適用、それ以外の場合はフィルタ条件を適用せず集計します。</li><li>xxxConditionCount: 同一項目で複数の条件を指定する場合の件数</li><li>xxx_ope_y: 比較演算子を指定します。*1</li><li>xxx_y: フィルタ時の値を指定します。*2</li><li>xxx_to_y: 比較演算子「RG」選択時の範囲の終わりの値を指定します。*2</li><li>xxx_in_y: 比較演算子「IN」選択時の値を指定します。複数ある場合はカンマで区切ります。*2</li><li>xxx_dateRange_y: 比較演算子「RD」、「RDT」選択時の値を指定します。*3</li><li>xxx_savedList_y: 比較演算子「SL」選択時の値を指定します。*4</li><li>xxx_compareAsString_y: 比較演算子「SL」選択時に文字列として比較するかを指定します。*4</li><li>filterExpression: 条件式を指定します。*5</li></ul><h4>*1 指定可能な比較演算子</h4><ul style=\"padding-left: 20px;\"><li>EQ: 等しい</li><li>NE: 等しくない</li><li>SW: 前方一致</li><li>LW: 後方一致</li><li>IC: 含む</li><li>NIC: 含まない</li><li>IN: いずれかと等しい</li><li>LT: より小さい</li><li>GT: より大きい</li><li>LE: 以下</li><li>GE: 以上</li><li>RG: 範囲</li><li>RD: 相対範囲(日付)</li><li>RDT 相対範囲(日時)</li><li>NNL: 値が設定されている</li><li>NL: 値が設定されていない</li><li>SL: 保存リストから</li></ul><h4>*2 値のフォーマットについて</h4><ul style=\"padding-left: 20px;\"><li>Boolean: trueまたはfalse</li><li>Date: yyyyMMdd</li><li>Datetime: yyyyMMddHHmmss</li><li>Reference: エンティティのOID</li><li>Select: SelectValueのvalue値</li><li>Time: HHmmss</li></ul><h4>*3 相対範囲の設定値について</h4><ul style=\"padding-left: 20px;\"><li>LAST_MONTH: 先月</li><li>THIS_MONTH: 今月</li><li>NEXT_MONTH: 翌月</li><li>LAST_WEEK: 先週</li><li>THIS_WEEK: 今週</li><li>NEXT_WEEK: 来週</li><li>YESTERDAY: 昨日</li><li>TODAY: 今日</li><li>TOMORROW: 明日</li><li>LAST_7_DAYS: 過去7日間</li><li>LAST_30_DAYS: 過去30日間</li><li>NEXT_7_DAYS: 翌7日間</li><li>NEXT_30_DAYS: 翌30日間</li></ul><h4>*4 保存リストからの設定値について</h4>保存リストのOID:列番号 の形式で指定します。<br />文字列として比較する場合、compareAsStringにはtrueを指定します。<h4>*5 条件式について</h4>条件式はキューブの場合のみ利用可能です。<br />指定時は$を\\$のようにエスケープする必要があります。</div>";
