LocaleInfo.generic_element_section_MassReferenceSection_filterConditionScriptDisplaNameKey = "絞り込み条件設定スクリプト";
LocaleInfo.generic_element_section_MassReferenceSection_filterConditionScriptDescriptionKey = "参照データ検索時に自動で絞り込みをする条件を指定するGroovyTemplateです。<br />WHERE句に指定する条件を文字列で指定してください。<br /><br />このスクリプトでは以下のGroovyTemplateのデフォルトバインディングと、PreparedQueryのデフォルトバインディングが利用出来ます。<br /><div style=\"width:99%; height:250px; overflow: auto; border:1px solid #000000;\"><h4>GroovyTemplate Binding</h4><ul style=\"padding-left: 20px;\"><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li><li>escHtml(Object) : 引数をHtmlエスケープ</li><li>escJs(Object) : 引数をJavascriptエスケープ</li><li>escSql(Object) : 引数をSQLエスケープ</li><li>escSqlLike(Object) : 引数をLike用SQLエスケープ</li><li>nte(Object) : 引数がnullの場合空文字に</li></ul><h4>PreparedQuery Binding</h4><ul style=\"padding-left: 20px;\"><li>user : 実行するユーザの情報 *1参照</li><li>date : 現在日時のjava.util.Dateのインスタンス。</li><li>sysdate : 現在日付（時間含まず）の文字列。例：2011-01-20</li><li>sysdatetime : 現在日時の文字列。例：2011-01-18 02:05:03.348</li><li>systime : 現在時間の文字列。例:23:19:00</li><li>toIn(Collection/Array): 引数をinの文字列表現に変換。利用例：\";oid in (${toIn(user.groupOid)})\";</li><li>toDateString(Date): 引数を日付の文字列表現に変換。利用例\";startDate > '${toDateString(date)}'\";</li><li>toLocalDateString(Date): 引数をローカル日付の文字列表現に変換。利用例\";startDate > '${toLocalDateString(date)}'\";</li><li>toDateTimeString(Date): 引数を日時の文字列表現に変換。利用例\";startDateTime > '${toDateTimeString(date)}'\";</li><li>toTimeString(Date): 引数を時間の文字列表現に変換。利用例\";startTime > '${toTimeString(date)}'\";</li><li>toLocalTimeString(Date): 引数をローカル時間の文字列表現に変換。利用例\";startTime > '${toLocalTimeString(date)}'\";</li><li>addYear(Date, int): 引数に指定の年を加えたjava.util.Dateインスタンスを取得する。利用例\";startDate > '${toDateString(addYear(date, -1))}'\";</li><li>addMonth(Date, int): 引数に指定の月を加えたjava.util.Dateインスタンスを取得する。利用例\";startDate > '${toDateString(addMonth(date, 3))}'\";</li><li>addWeek(Date, int): 引数に指定の週を加えたjava.util.Dateインスタンスを取得する。利用例\";startDate > '${toDateString(addWeek(date, -2))}'\";</li><li>addDay(Date, int): 引数に指定の日を加えたjava.util.Dateインスタンスを取得する。利用例\";startDate > '${toDateString(addDay(date, 10))}'\";</li><li>addHour(Date, int): 引数に指定の時間を加えたjava.util.Dateインスタンスを取得する。利用例\";startDateTime > '${toDateTimeString(addHour(date, -12))}'\";</li><li>addMinute(Date, int): 引数に指定の分を加えたjava.util.Dateインスタンスを取得する。利用例\";startTime > '${toTimeString(addMinute(date, 30))}'\";</li><li>addSecond(Date, int): 引数に指定の秒を加えたjava.util.Dateインスタンスを取得する。利用例\";startTime > '${toTimeString(addSecond(date, -10))}'\";</li><li>addMillisecond(Date, int): 引数に指定のミリ秒を加えたjava.util.Dateインスタンスを取得する。利用例\";startDateTime > '${toDateTimeString(addMillisecond(date, -500))}'\";</li></ul><h4>*1 userについて</h4>userが所属するグループに関する以下の変数、関数を呼び出すことが出来ます。<ul style=\"padding-left: 20px;\"><li>groupCode : 所属グループのグループコードのString[]。</li><li>groupCodeWithChildren : 所属グループ(配下グループ含む)のグループコードのString[]。</li><li>groupCodeWithParents : 所属グループ(上位グループ(ルートまで)含む)のグループコードのString[]。</li><li>groupOid : 所属グループのoidのString[]。</li><li>groupOidWithChildren : 所属グループ(配下グループ含む)のグループのoidのString[]。</li><li>groupOidWithParents : 所属グループ(上位グループ(ルートまで)含む)のグループのoidのString[]。</li><li>memberOf(String): 引数のグループコードのメンバ(サブグループに所属していても)の場合trueを返す。</li></ul></div><br />設定例:<div style=\"width:99%; height:140px; overflow: auto; border:1px solid #000000;\">&lt;%@import java.sql.Timestamp%&gt;<br />&lt;%@import java.text.SimpleDateFormat %&gt;<br />&lt;%<br />def date = new SimpleDateFormat(\"yyyy/MM/dd\").parse(\"2012/09/06\");<br />def timestamp = new Timestamp(date.getTime());<br />%&gt;<br />createDate&lt;='${timestamp}' and createBy='${user.getAttribute(\"oid\")}'</div>";
