LocaleInfo.ui_metadata_scheduling_ScheduleTaskAttributePane_taskCaptionHint = "<h3>About Task Type</h3><p>実行するタスクに関して設定します。</p><table><tr><th>Property</th><th>Description</th></tr><tr><td>Task Type</td><td>CommandまたはWorkflowを実行することができます。</td></tr></table><p>Command、Workflowにはタスクの実行時間がバインドされます。</p><table><tr><td>Command</td><td>RequestContextのAttributeに「ScheduledTaskRequestConstants.SCHEDULED_TIME」で設定されます。</td></tr><tr><td>Workflow</td><td>開始パラメータとして「ScheduledTaskRequestConstants.SCHEDULED_TIME」で設定されます。</td></tr></table><p>org.iplass.mtp.scheduling.ScheduledTaskRequestConstants</p>";
LocaleInfo.ui_metadata_scheduling_ScheduleTaskAttributePane_userExpressionScriptHint = "<h3>About User Expression Type</h3><table><tr><td>NONE :</td><td>ユーザ未指定(システムユーザとして特権で実行されます)</td></tr><tr><td>BY_SCRIPT :</td><td>Scriptの戻り値としてユーザID(String)を返してください。</td></tr><tr><td>BY_EQL :</td><td>User Entityに対するWhere条件を指定してください。</td></tr><tr><td>BY_STRING :</td><td>GroovyTemplate形式でユーザIDを指定してください。</td></tr></table>";
LocaleInfo.ui_metadata_scheduling_ScheduledWorkflowEditPane_startParameterScriptHint = "<h3>About Start Parameter Script</h3><p>Workflowの開始時のパラメータを指定することができます。startParamMapとしてバインドされているマップにパラメータを指定してください。</p>";
