LocaleInfo.ui_metadata_scheduling_CronExpressionScheduleEditPane_cronExpressionScriptHint = "<h3>Cron example</h3><table><tr><td>\"0 0 * * * *\" :</td><td>毎時に実行</td></tr><tr><td>\"0 */30 * * * *\" :</td><td>30分毎に実行</td></tr><tr><td>\"0 0 7-9 * * *\" :</td><td>毎日の7,8,9時に実行</td></tr><tr><td>\"0 0 18 * * MON-FRI\" :</td><td>月～金の18時に実行</td></tr></table>";
