LocaleInfo.ui_metadata_scheduling_CustomScheduleEditPane_customExpressionScriptHint = "<h3>About Custom Script</h3><p>タスク実行の都度、設定されたscriptが呼び出されるので、次回の実行日時を、java.util.Date形式もしくはUTCのlongのミリ秒値で返却するように実装します。</p><p>以下の変数がバインドされます。</p><table><tr><td>scheduledTime</td><td>今回実行したタスクのスケジュールされた日時</td></tr><tr><td>actualStartTime</td><td>今回実行したタスクが実際に実行開始された日時</td></tr><tr><td>actualEndTime</td><td>今回実行したタスクが実際に実行完了した日時</td></tr></table>";
